import { Component } from '@angular/core';
import { MySerService } from '../../Service/my-ser.service';

@Component({
  selector: 'app-img',
  templateUrl: './img.component.html',
  styleUrls: ['./img.component.css']
})
export class ImgComponent {
  getTypeFileList: string[] |undefined;
  getFileList:string[] |undefined;

  constructor(private myServe:MySerService){}



  ngOnInit() {
    this.getFileList = [];
    this.myServe.getListToClient().subscribe(
      data => {
       this.getFileList = data;
       alert("get files sucssesfuly");
      },
      err => {
        alert(err.message);
      }
      );

    this.myServe.getTypeFileListToClient().subscribe(
      data => {
        this.getTypeFileList = data;
        alert("get files sucssesfuly");
      },
      err => {
        alert(err.message);
      }
      );


  }


  itsBig:boolean=false;
  makeBig(){
    this.itsBig=true;
  }
}
